pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;

contract System {
    struct Prontuario {
        string name;
        string cpf;
        string nome_social;
        string dt_nasc;
        string sexo;
        string cor_raca; 
        string nome_da_mae;
        string nome_do_pai;

        string nacionalidade;
        string municipio;
        string rg;
        string telefone; 
        string email;
        string pais;
        string cep; 
        string estado; 
        
        string bairro; 
        string logradouro;
        string numero; 
        string complemento;
        string referencia;
        string area;
        string microarea;

        string estado_civil;
        string NIS_PIS_PASEP;
        string n_prontuario;
        string ocupacao; 
        string escolaridade;
        string tipo_sanguineo; 

        string orientacao_sexual;
        string identidade_de_genero;
    }


    struct Paciente {
        address userAddress;
        Prontuario userProntuario;
        bool set;
    }

    mapping(address => Paciente) public pacientes;

    event PacienteCriado(
        address userAddress,
        Prontuario userProntuario
    );


    function AdicionarPaciente(address _userAddress,
        string memory _name,
        string memory _cpf
        /*string memory _nome_social,
        string memory _dt_nasc,
        string memory _sexo,
        string memory _cor_raca,
        string memory _nacionalidade*/
       ) public {
        Paciente storage pc = pacientes[_userAddress];
        // Check that the user did not already exist:
        require(!pc.set, "Already set the patient");
        
        pc.userAddress = _userAddress;
        pc.set = true;

        pacientes[_userAddress].userProntuario.name = _name;
        pacientes[_userAddress].userProntuario.cpf = _cpf;
        /*pacientes[_userAddress].userProntuario.nome_social = _nome_social;
        pacientes[_userAddress].userProntuario.dt_nasc = _dt_nasc;
        pacientes[_userAddress].userProntuario.sexo = _sexo;
        pacientes[_userAddress].userProntuario.cor_raca = _cor_raca;
        pacientes[_userAddress].userProntuario.nacionalidade = _nacionalidade;*/

        /*pc.userProntuario = Prontuario(_name,
         _cpf,
         _nome_social,
         _dt_nasc,
         _sexo,
         _cor_raca,        
         _nacionalidade
      );*/

        emit PacienteCriado(pc.userAddress, pc.userProntuario);
       
    }
}
